import Wallpaper from "./components/wallpaper";
import About from "./components/about";

const windowData = [
  { title: "About", icon: "/icon/thomas-icon.png", bodyContent: <About /> },
  {
    title: "Websites",
    icon: "/icon/folder.png",
    bodyContent: { component: <SingleSite />, props: "body props" }
  },
  { title: "Preferences", icon: "/icon/mac.png", bodyContent: {component: <Wallpaper />} }
];

export default windowData;
